import React from 'react';

const Home = () => {
    return (
        <body>
            <div>
                <p>Introducing sensei</p>
            </div>
            <hr />
            <div>
                <h1>Master Software Skills with AI-Powered Tutoring</h1>
            </div>
        </body>
    );
};

export default Home;
